INSERT INTO "public"."info" VALUES ('151', ' 江苏电力交易中心有限公司揭牌', ' 江苏电力交易中心有限公司揭牌', '1', '<p>
	4月18日上午，江苏电力交易中心有限公司成立大会暨揭牌仪式在南京举行。这是国网江苏省电力公司落实中央深化电力体制改革部署，推动构建有效竞争
的江苏电力市场实施的重大举措。该公司是华东地区首家成立的电力交易中心，也是全国首个大型省级受端电网交易中心。江苏省人民政府、江苏省经济和信息化委
员会、国家能源局江苏监管办公室、国网江苏省电力公司共同为江苏电力交易中心有限公司揭牌。
</p>
<p>
	江苏是经济大省、用能大省，各类电力交易总量均位于全国前列。江苏电力交易中心有限公司的成立，有利于促进江苏电力市场公平交易，推动形成有效的市场竞争机制，发挥市场配置资源的决定性作用，实现电力资源优化配置，推动江苏电力和能源工业可持续发展。
</p>
<p>
	江苏电力交易中心有限公司成立后，在业务上与电网企业其他业务分开，在财务上独立核算、自负盈亏，在运营上按照政府批准的章程和市场规则提供交易服
务，将有力促进江苏电力市场化改革进程，有效释放改革红利。同时，将为发电企业、售电企业、电力用户等市场主体搭建流程规范、运作透明、功能完善、便于监
管的交易平台，提供公平高效的优质服务，降低交易成本，提高市场效率，满足全省日益增长的电力交易需求。
</p>
<p>
	当前，江苏正统筹推进经济建设、政治建设、文化建设、社会建设、生态文明建设和党的建设，着力建设经济强、百姓富、环境美、社会文明程度高的新江
苏，江苏电力交易中心有限公司的成立将为加快江苏产业升级，支持实体经济发展，构建有效竞争的江苏电力市场体系提供组织保障和技术支撑，为创建强富美高的
新江苏贡献一份力量。
</p>
<p>
	江苏电力交易中心有限公司成立后，将不断完善运行模式、工作机制和业务流程，主动接受政府监管和社会监督，切实维护市场秩序和市场主体合法利益，让政府放心、让客户满意。
</p>
<p>
	江苏省政府、省经信委、江苏能源监管办有关领导，发电集团、重要电力客户有关负责人，国网江苏省电力公司领导班子成员等参加揭牌仪式。
</p>
<p>
	<br />
来源：国网江苏省电力公司
</p>', '', '58', '2016-07-07 23:01:58.763', '2016-07-07 23:01:58.763', '1', '0');

